const DATASETS = {
    ENTITY_LIST: '',
    WORK_ORDERS: '',
};
var loaded_data = {}

/**
 * Adds the 'expanded' class to the PAM header after a delay to trigger the animation.
 * 
 * This function waits for the DOM to be fully loaded, then waits PAM_HEADER_EXPAND_DELAY_MS
 * before adding the 'expanded' class to the element with the 'pam-header' class. This triggers
 * the CSS animation that expands the header text.
 */
window.addEventListener('DOMContentLoaded', function() {
    setTimeout(function() {
        var header = document.querySelector('.pam-header');
        if (header) {
            header.classList.add('expanded');
        }
    }, PAM_HEADER_EXPAND_DELAY_MS);
});


/**
/**
 * Loads a dataset from a JSON file and filters it by a parameter.
 *
 * @param {string} datasetName - The shared dataset name.
 * @param {string} paramName - The property name to filter by (e.g., 'group').
 * @param {string|number} paramValue - The value to match for the property (e.g., 'Test Group').
 * @param {function} callback - Function to call with the filtered data array.
 *
 * Example usage:
 * loadAndFilterDataset('equipment-groups.json', 'group', 'Test Group', function(results) {
 *     console.log(results);
 * });
 */
function loadAndFilterDataset(datasetName, paramName, paramValue, callback) {
    var xhr = new XMLHttpRequest();
    var url = `${DATASET_PATH + datasetName}')/data?`
    paramName ? url = `${url}&${paramName}=${paramValue}` : console.log('parameter not present')


    xhr.open('GET', url , true);

    xhr.onreadystatechange = function() {
        if (xhr.readyState === 4 && xhr.status === 200) {
            try {
                var data = JSON.parse(xhr.responseText);
                // Filter the data by paramName and paramValue
                loaded_data['data'] = data.value
                //callback(data);
            } catch (e) {
                console.error('Error parsing dataset:', e);
                //callback([]);
            }
        }
    };

    xhr.send();
}
